use strict;
use warnings;

# pre-allocate the array
my @revXref;

sub mapRev {
    my $rev = shift;
    init() unless ( scalar @revXref );
    return "Rev $rev not found" if $rev > scalar @revXref;
    return $revXref[$rev] if $revXref[$rev];
    return "Rev $rev not found";
}

sub init {
    $revXref[18000] = '';
    while (<DATA>) {
        my $l = $_;
        chomp $l;
        my ( $rn, $rp, $br, $rf ) = split( /:/, $l );
        $rf = $br unless ($rf);
        $rf = substr( $rf, 0, 12 );
        if ( $revXref[$rn] ) {
            $revXref[$rn] .= "~$rp:$rf";
        }
        else {
            $revXref[$rn] = "$rp:$rf";
        }

        #print "$revXref[$rn]\n";
    }
}
